import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import Fonts from './fonts.json'
import './App.css';
import FontSelector from './FontSelector';

/**
 * 読み込むフォント
 */
const fonts = Fonts;

const Main = () => {
  return (
    <div className="App-header">
      <FontSelector props={fonts} />
    </div>
  );
}

const App: React.FC = () => {
  return (
    <div className="main">
      <Main />
    </div>
  );
}

export default App;
